import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
export default function Slider() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      <div>Slider</div>;
      <div>Slider</div>;
      <div>Slider</div>;
      <div>Slider</div>;
      <div>Slider</div>;
      <div>Slider</div>;
    </Slider>
  );
}
